import styled from 'styled-components';

const Container = styled.div`
  border: 1px solid blue;
  width: 100%;
  height: 100%;
  box-sizing: border-box;
  overflow-y: scroll;
  padding-top: ${props => props.navHeightPadding}; /*For top Nav */
`;

export default Container;
